# from __future__ import annotations
# from typing import List

"""

Given an n x n grid containing only values 0 and 1, where 0 represents water and 1 represents land, find a water cell such that its distance to the nearest land cell is maximized, and return the distance. If no land or water exists in the grid, return -1.

The distance used in this problem is the Manhattan distance: the distance between two cells (x0, y0) and (x1, y1) is |x0 - x1| + |y0 - y1|.

Example 1:

Input: grid = [[1,0,1],[0,0,0],[1,0,1]]
Output: 2
Explanation: The cell (1, 1) is as far as possible from all the land with distance 2.

Example 2:

Input: grid = [[1,0,0],[0,0,0],[0,0,0]]
Output: 4
Explanation: The cell (2, 2) is as far as possible from all the land with distance 4.



Constraints:

    n == grid.length
    n == grid[i].length
    1 <= n <= 100
    grid[i][j] is 0 or 1


"""
MAGIC_SEPARATOR = 200 # as maximum distance is 100 according to the
# problem constraints
NO_LAND_FOUND_YET_VALUE = 999

class Solution:


    def maxDistance(self, grid: List[List[int]]) -> int:
        n = len(grid)
        # found_both_water_and_land = False
        # first_tile_type = grid[0][0] # value is 0 for type water, 1 for type land

        magic_max_distance = -1
        max_distance_indices = (-1,-1)

        last_land_tile = None
        if not grid[0][0]:
            grid[0][0] = NO_LAND_FOUND_YET_VALUE
        else:
            last_land_tile = (0,0)



        # populate first row
        for j in range(1, n):
            if not grid[0][j]:
                # water tile
                if grid[0][j - 1] == NO_LAND_FOUND_YET_VALUE:
                    grid[0][j] = NO_LAND_FOUND_YET_VALUE
                elif grid[0][j - 1] == 1:
                    grid[0][j] = 201  # MAGIC_SEPARATOR + 1, as distance to
                    # land is 1
                    if magic_max_distance == -1:
                        magic_max_distance = 201
                        max_distance_indices = (0,j)
                else:
                    grid[0][j] = grid[0][j - 1] + 1
                    if magic_max_distance < grid[0][j]:
                        magic_max_distance = grid[0][j]
                        max_distance_indices = (0,j)

            else:
                last_land_tile = (0,j)

        # populate first column
        for i in range(1,n):
            if not grid[i][0]:
                #water tile
                if grid[i-1][0] == NO_LAND_FOUND_YET_VALUE:
                    grid[i][0] = NO_LAND_FOUND_YET_VALUE
                elif grid[i-1][0] == 1:
                    grid[i][0] = 201 # MAGIC_SEPARATOR + 1, as distance to
                    # land is 1
                    if magic_max_distance == -1:
                        magic_max_distance = 201
                        max_distance_indices = (i,0)

                else:
                    grid[i][0] = grid[i-1][0] + 1
                    if magic_max_distance < grid[i][0]:
                        magic_max_distance = grid[i][0]
                        max_distance_indices = (i,0)

            else:
                last_land_tile = (i,0)

        for i in range(1,n):
            for j in range(1,n):
                if not grid[i][j]: # ie, if on water tile
                    magic_distance = min(grid[i-1][j], grid[i][j-1])
                    if magic_distance == NO_LAND_FOUND_YET_VALUE:
                        grid[i][j] = NO_LAND_FOUND_YET_VALUE
                    elif magic_distance == 1:
                        grid[i][j] = 201
                        if magic_max_distance == -1:
                            magic_max_distance = 201
                            max_distance_indices = (i, j)
                    else:
                        grid[i][j] = magic_distance + 1
                        if magic_max_distance < grid[i][j]:
                            magic_max_distance = grid[i][j]
                            max_distance_indices = (i, j)
                else:
                    last_land_tile = (i, j)

        # print("we here, max distance is : ", magic_max_distance)
        # print_mat(grid)

        if not last_land_tile:
            return -1

        solution_found_in_optimised_submatrix = None
        if last_land_tile[0]<=max_distance_indices[0] and last_land_tile[
            1]<=max_distance_indices[1]:
            solution_found_in_optimised_submatrix= magic_max_distance - \
                                                   MAGIC_SEPARATOR

        magic_max_distance = -1 #this needs to be recomputed
        i = n-1
        for j in range(last_land_tile[1]-1, -1,-1):
            if grid[i][j] !=1:
                #water tile case
                if grid[i][j] > grid[i][j+1] + 1:
                    if grid[i][j+1] == 1:
                        grid[i][j] = 201
                    else:
                        grid[i][j] = grid[i][j + 1] + 1
                if grid[i][j] > magic_max_distance:
                    magic_max_distance = grid[i][j]

        for i in range( n - 2,last_land_tile[0] - 1, -1):
            for j in range(last_land_tile[1] - 1, -1, -1):
                if grid[i][j] != 1:
                    # water tile case
                    magic_distance = min(grid[i][j + 1], grid[i+1][j]) + 1
                    if grid[i][j] > magic_distance:
                        if magic_distance == 2:
                            grid[i][j] = 201
                        else:
                            grid[i][j] = magic_distance
                    if grid[i][j] > magic_max_distance:
                        magic_max_distance = grid[i][j]

        j = n - 1
        for i in range(last_land_tile[0] - 1, -1, -1):
            if grid[i][j] !=1:
                # water tile case
                if grid[i][j] > grid[i+1][j] + 1:
                    if grid[i+1][j] == 1:
                        grid[i][j] = 201
                    else:
                        grid[i][j] = grid[i+1][j ] + 1
                if grid[i][j] > magic_max_distance:
                    magic_max_distance = grid[i][j]

        for i in range(last_land_tile[0] - 1, -1, -1):
            for j in range(n - 2, -1, -1):
                if grid[i][j] != 1:
                    # water tile case
                    magic_distance = min(grid[i][j + 1], grid[i + 1][j]) + 1
                    if grid[i][j] > magic_distance:
                        if magic_distance == 2:
                            grid[i][j] = 201
                        else:
                            grid[i][j] = magic_distance
                    if grid[i][j] > magic_max_distance:
                        magic_max_distance = grid[i][j]

        # print_mat(grid)

        if magic_max_distance > MAGIC_SEPARATOR:
            magic_max_distance = magic_max_distance - MAGIC_SEPARATOR
        if solution_found_in_optimised_submatrix:
            magic_max_distance = max(solution_found_in_optimised_submatrix,
                                     magic_max_distance)
        return magic_max_distance





